import React from 'react';
import { createRoot } from 'react-dom/client';

import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { AuthProvider } from './auth/AuthProvider';


const container = document.getElementById('root');
const root = createRoot(container);

// Shim in a `destroy()` alias so HMR’s runtime won’t crash
// (Fast-Refresh expects root.destroy; React 18 only has unmount())
root.destroy = root.unmount;

  root.render(
    <React.StrictMode>
      <AuthProvider>
        <App />
      </AuthProvider>
    </React.StrictMode>
  );

reportWebVitals();
